 <p><span style='font-family:&quot;PingFangSC-Regular&quot;,&quot;PingFang SC&quot;,sans-serif'>列表数据来源</span><p><span style='font-family:&quot;PingFangSC-Regular&quot;,&quot;PingFang SC&quot;,sans-serif'>每周一次，从ins爬取限定条件的网红信息，每次500条</span><p><span style='font-family:&quot;PingFangSC-Regular&quot;,&quot;PingFang SC&quot;,sans-serif'><br></span><p><span style='font-family:&quot;PingFangSC-Regular&quot;,&quot;PingFang SC&quot;,sans-serif'>条件</span><p><span style='font-family:&quot;PingFangSC-Regular&quot;,&quot;PingFang SC&quot;,sans-serif'>①指定tag话题：【待业务提供】</span><p><span style='font-family:&quot;PingFangSC-Regular&quot;,&quot;PingFang SC&quot;,sans-serif'>②粉丝量限定区间：&amp;gt;5000</span><p><span style='font-family:&quot;PingFangSC-Regular&quot;,&quot;PingFang SC&quot;,sans-serif'>③国家/地区限定：沙特, 阿联酋, 卡塔尔，科威特, 阿曼, 巴林</span><p><span style='font-family:&quot;PingFangSC-Regular&quot;,&quot;PingFang SC&quot;,sans-serif'>④和IRM已合作网红去重：从IRM合作中的网红资料中取填写了ins链接的网红，对比ins账号名和系统保存的网红名，相同则过滤掉不保存</span><p><span style='font-family:&quot;PingFangSC-Regular&quot;,&quot;PingFang SC&quot;,sans-serif'>⑤和线索池已有网红去重</span><p><span style='font-family:&quot;PingFangSC-Regular&quot;,&quot;PingFang SC&quot;,sans-serif'>&amp;nbsp;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; 状态≠不合作的网红，去重，不做更新 </span><p><span style='font-family:&quot;PingFangSC-Regular&quot;,&quot;PingFang SC&quot;,sans-serif'>&amp;nbsp;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; 状态=不合作的网红，若粉丝数量涨幅＞30%，则更新数据，状态重新置为“待领取”</span><p><span style='font-family:&quot;PingFangSC-Regular&quot;,&quot;PingFang SC&quot;,sans-serif'>⑥性别：通过最近的10个帖子首图识别，过滤图片中出现男性超过5个的用户</span></p>
